sources.styles/utils/reset.scss:
html,
body,
h1,
h2,
p,
a,
ul {
  margin: 0;
  padding: 0;
}

ul {
  list-style: none;
}

* {
  box-sizing: border-box;
}

a {
  text-decoration: none;
}

sources.styles/blocks/page.scss:
.page {
  font-family: "Inter", sans-serif;
  font-weight: 700;

  scroll-behavior: smooth;

  &__body {
    &--with-menu {
      overflow: hidden;
    }
  }

  &__menu {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;

    transform: translateX(-100%);

    @include transition (transform);

    &:target {
      transform: translateX(0);
    }
  }

  &__section {
    margin-top: 120px;

    &-title {
      margin-bottom: 48px;

      @include fontSize (32px, 32px);
      text-align: center;
      letter-spacing: -1.5px;
      color: $main-color;

      @include onTablet {
        margin-bottom: 64px;

        @include fontSize (40px, 40px);
      }

      @include onDesktop {
        @include fontSize (48px, 48px);
      }
    }
  }

  &__product {
    margin-bottom: 48px;

    @include onTablet {
      margin-bottom: 40px;
    }

    @include onDesktop {
      margin-bottom: 0;
    }

    &--last {
      margin-bottom: 0;
    }
  }

  &__category {
    margin-bottom: 40px;

    @include onTablet {
      margin-bottom: 64px;
    }

    &--last {
      margin-bottom: 40px;
    }
  }
}

sources.styles/utils/mixins.scss:
@mixin onTablet {
  @media (min-width: 640px) {
    @content;
  }
}

@mixin onDesktop {
  @media (min-width: 1024px) {
    @content;
  }
}

@mixin top-actions {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

@mixin transition ($property) {
  transition: $property 0.5s;
}

@mixin fontSize ($font-size, $line-height) {
  font-size: $font-size;
  line-height: $line-height;
}

@mixin image-properties () {
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
}

sources.styles/blocks/header.scss:
.header {
  background-image: url(../images/header_small.jpg);
  @include image-properties;

  @include onTablet {
    background-image: url(../images/header_mid.jpg);
  }

  @include onDesktop {
    background-image: url(../images/header.jpg);
  }

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    height: 100vh;
    padding: $header-top-padding 0 94px;

    @include onTablet {
      padding: $header-top-padding-inTablet 0 40px;
    }

    @include onDesktop {
      padding-bottom: 64px;
    }
  }

  &__top {
    @include top-actions;
  }

  &__buttons {
    display: flex;
    gap: 30px;

    @include onTablet {
      gap: 40px;
    }
  }

  &__title {
    font-style: italic;
    font-weight: 800;
    @include fontSize (32px, 32px);
    color: $main-color;

    letter-spacing: -1.5px;

    @include onTablet {
      @include fontSize (40px, 40px);
    }

    @include onDesktop {
      @include fontSize (48px, 48px);
    }

    &::before {
      content: "";

      display: block;
      width: 32px;
      height: 27px;
      margin-bottom: 16px;

      background-image: url(../images/wave.svg);
      @include image-properties ();

      @include transition (background-image);

      @include onTablet {
        width: 63px;
        height: 76px;
        margin-bottom: 40px;
        background-image: url(../images/Sound-waves.svg);
      }

      @include onDesktop {
        margin-bottom: 32px;
      }
    }
  }
}

sources.styles/blocks/container.scss:
.container {
  margin: 0 auto;
  max-width: 1020px;
  width: 100%;
  padding: 0 20px;

  @include onTablet {
    padding: 0 72px;
  }

  @include onDesktop {
    padding: 0;
  }
}

sources.styles/blocks/icon.scss:
.icon {
  position: relative;
  display: block;
  width: 18px;
  padding-bottom: 18px;

  @include image-properties ();

  @include onTablet() {
    width: 24px;
    height: 24px;
  }

  &--phone {
    background-image: url(../images/tel.svg);
  }

  &__tooltip {
    position: absolute;
    right: 100%;
    top: 50%;
    transform: translateY(-50%);

    display: block;
    width: max-content;
    padding-right: 20px;

    @include fontSize (12px, 16px);
    color: $main-color;
    letter-spacing: 2px;
    text-transform: uppercase;
    opacity: 0;
    @include transition(opacity);
    pointer-events: none;
  }

  &:hover &__tooltip {
    opacity: 1;
    pointer-events: all;
  }

  &--menu {
    background-image: url(../images/menu.svg);

    @include transition(background-image);

    @include onTablet {
      background-image: url(../images/Vector.png);
    }

    &:hover {
      background-image: url(../images/menu_hover.svg);
    }
  }

  &--cross {
    background-image: url(../images/menu_cross.svg);
  }
}

sources.styles/blocks/menu.scss:
.menu {
  background-color: $menu-color;

  &__content {
    height: 100vh;
    padding: $header-top-padding 0;

    overflow-y: auto;

    @include onTablet {
      padding: $header-top-padding-inTablet 0 40px;
    }
  }

  &__top {
    @include top-actions;
    margin-bottom: 55px;

    @include onTablet {
      margin-bottom: 60px;
    }

    @include onDesktop {
      margin-bottom: 78px;
    }
  }

  &__list {
    margin: 0 0 40px;
  }

  &__item {
    margin-bottom: 24px;

    &:last-child {
      margin-bottom: 0;
    }
  }

  &__link {
    display: inline-block;
    padding-bottom: 8px;

    @include fontSize (22px, 22px);
    letter-spacing: 2px;
    text-transform: uppercase;
    color: $main-color;

    border-bottom: 1px solid transparent;

    @include transition (border-color);

    &:hover {
      border-color: $main-color;
    }
  }

  &__call {
    display: block;
    width: max-content;
    text-transform: uppercase;

    color: $main-color;

    &--phone {
      margin-bottom: 16px;
      @include fontSize (16px, 27px);
    }

    &--action {
      padding-bottom: 8px;

      @include fontSize (12px, 16px);
      letter-spacing: 2px;

      border-bottom: 1px solid $main-color;
    }
  }
}

