sources.styles/blocks/grid.scss:
.grid {
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  column-gap: 20px;

  @include onTablet {
    grid-template-columns: repeat(6, 1fr);
    column-gap: 24px;
  }

  @include onDesktop {
    grid-template-columns: repeat(12, 1fr);
  }

  &__item {
    @for $start from 1 through 2 {
      @for $end from $start through 2 {
        &--#{$start}-#{$end} {
          grid-column: #{$start} / #{$end + 1};
        }
      }
    }

    @for $start from 1 through 6 {
      @for $end from $start through 6 {
        &--tablet-#{$start}-#{$end} {
          @include onTablet {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }

    @for $start from 1 through 12 {
      @for $end from $start through 12 {
        &--desktop-#{$start}-#{$end} {
          @include onDesktop {
            grid-column: #{$start} / #{$end + 1};
          }
        }
      }
    }
  }
}

sources.styles/blocks/product.scss:
.product {
  &__image {
    display: block;
    width: 280px;
    height: 277px;
    margin: 0 auto 32px;

    @include transition (transform);

    &:hover {
      transform: scale(1.2);
    }

    @include onTablet {
      width: 392px;
      height: 387px;
    }

    @include onDesktop {
      width: 324px;
      height: 320px;
    }
  }

  &__subtitle {
    display: block;
    margin-bottom: 8px;

    @include fontSize (16px, 22px);
    color: $main-color;

    cursor: pointer;
  }

  &__class {
    margin-bottom: 12px;

    font-weight: 400;
    @include fontSize (16px, 22px);

    color: $main-color;
  }

  &__price {
    @include fontSize (16px, 22px);

    color: $main-color;
  }
}

sources.styles/blocks/category.scss:
.category {
  &__photos {
    margin-bottom: 16px;
  }

  &__photo-container {
    position: relative;

    width: 100%;
    max-height: 321px;

    overflow: hidden;

    &::after {
      content: "";
      display: block;
      padding-bottom: 100%;
    }

    @include onTablet {
      height: 187px;
      padding-bottom: 0;
    }

    @include onDesktop {
      height: 330px;
    }
  }

  &__photo {
    position: absolute;

    width: 100%;
    height: 100%;

    object-fit: cover;
    object-position: center;

    @include transition (transform);

    &:hover {
      transform: scale(1.2);
    }
  }

  &__subtitle {
    @include fontSize (16px, 22px);

    color: $main-color;

    @include onTablet {
      @include fontSize (24px, 34px);
    }
  }
}

sources.styles/blocks/button.scss:
.button {
  display: flex;
  justify-content: center;
  align-items: center;

  width: 100%;
  height: 56px;

  @include fontSize (16px, 27px);
  color: $white-color;

  background-color: $main-color;
  border: 3px solid $main-color;
  border-radius: 40px;

  cursor: pointer;
  @include transition (all);

  &--primary {
    background-color: $main-color;
    border: 3px solid $main-color;
    color: $white-color;
  }

  &:hover {
    background-color: $white-color;
    color: $main-color;
  }

  &:active {
    background-color: $dark-color;
    color: $white-color;
  }
}

sources.styles/blocks/why-bose.scss:
.why-bose {
  &__title {
    margin-bottom: 32px;

    @include fontSize (32px, 32px);
    letter-spacing: -1.5px;

    color: $main-color;

    @include onTablet {
      margin-bottom: 0;

      @include fontSize (40px, 40px);
    }

    @include onDesktop {
      @include fontSize (48px, 48px);
    }
  }

  &__paragraph {
    font-weight: 400;
    @include fontSize (16px, 27px);

    color: $main-color;

    &--bold {
      margin-bottom: 16px;

      @include fontSize (16px, 22px);
      font-weight: 700;

      &:nth-child(4) {
        margin-bottom: 40px;
      }
    }
  }
}

sources.styles/blocks/contacts.scss:
.contacts {
  &__info {
    margin: 0 0 24px;

    &--last {
      margin-bottom: 32px;
    }
  }

  &__info-title {
    margin: 0 0 8px;

    font-weight: 400;
    @include fontSize (14px, 20px);

    color: #9fadc2;
  }

  &__info-link {
    font-weight: 400;
    @include fontSize (16px, 22px);

    color: #3e3e3e;

    &:hover {
      color: #000;
    }
  }

  &__field {
    margin: 0 0 16px;

    &--last {
      margin-bottom: 32px;
    }
  }

  &--last {
    margin-bottom: 48px;

    @include onTablet {
      margin-bottom: 0;
    }
  }
}

sources.styles/blocks/form-field.scss:
.form-field {
  display: block;
  width: 100%;
  height: 48px;
  padding: 14px 16px;

  border-radius: 40px;
  border: 2px solid transparent;
  background-color: #f8f8fa;

  @include transition (all);

  &::placeholder {
    font-weight: 400;
    @include fontSize (14px, 20px);

    color: #7e7e83;
  }

  &:hover {
    border-color: #d5d7de;

    &::placeholder {
      color: $main-color;
    }
  }

  &:focus {
    color: $main-color;

    border-color: $main-color;
    outline: none;
  }

  &--textarea {
    font-family: inherit;
    height: 148px;
    resize: none;
  }
}
